tables.table_schema:
CREATE TABLE QuantumAnalysis (
  id SERIAL PRIMARY KEY,
  measurement_name VARCHAR(50) NOT NULL,
  measurement_outcome VARCHAR(50) NOT NULL,
  measurement_value FLOAT NOT NULL
);

CREATE TABLE QuantumMeasurements (
    id INT PRIMARY KEY,
    measurement_name VARCHAR(50),
    measurement_value FLOAT
);

CREATE TABLE quantum_measurements (
    measurement_id INT PRIMARY KEY,
    quantum_system_id INT,
    measurement_time TIMESTAMP,
    measurement_outcome VARCHAR
);

CREATE TABLE quantum_systems (
    quantum_system_id INT PRIMARY KEY,
    system_name VARCHAR,
    system_type VARCHAR
);

CREATE TABLE quantum_measurements (
    measurement_id UUID PRIMARY KEY,
    measurement_type VARCHAR(50) NOT NULL,
    outcome TEXT NOT NULL,
    measurement_value FLOAT
);

CREATE TABLE statistical_analysis (
    analysis_id UUID PRIMARY KEY,
    analysis_name VARCHAR(100) NOT NULL,
    analysis_type VARCHAR(50) NOT NULL,
    analysis_result JSONB
);

CREATE TABLE data_sources (
    source_id UUID PRIMARY KEY,
    source_name VARCHAR(100) NOT NULL,
    source_type VARCHAR(50) NOT NULL,
    source_description TEXT
);

CREATE TABLE researchers (
    researcher_id UUID PRIMARY KEY,
    researcher_name VARCHAR(100) NOT NULL,
    researcher_department VARCHAR(100),
    researcher_email VARCHAR(100)
);

CREATE TABLE QuantumMeasurements (
  measurement_id UUID PRIMARY KEY,
  experiment_id UUID NOT NULL,
  measurement_time TIMESTAMP NOT NULL,
  outcome VARCHAR(50) NOT NULL
);

CREATE TABLE Experiments (
  experiment_id UUID PRIMARY KEY,
  experiment_name VARCHAR(100) NOT NULL,
  experiment_date DATE NOT NULL,
  researcher_name VARCHAR(100) NOT NULL
);

CREATE TABLE Researcher (
  researcher_id UUID PRIMARY KEY,
  researcher_name VARCHAR(100) NOT NULL,
  expertise_area VARCHAR(100) NOT NULL
);

CREATE TABLE OutcomeAnalysis (
  analysis_id UUID PRIMARY KEY,
  measurement_id UUID NOT NULL,
  analysis_date DATE NOT NULL,
  outcome_success BOOLEAN NOT NULL
);

CREATE TABLE StatisticalAnalysis (
  analysis_id UUID PRIMARY KEY,
  analysis_name VARCHAR(100) NOT NULL,
  analysis_type VARCHAR(50) NOT NULL,
  analysis_result JSONB
);
